import initial from './pages/initial';
import OtpVerification from './pages/OtpVerification';



class Router {
    constructor() {
        console.log('routes constructors');
        // this.setRoutes();
        this.routes = [
            { path: '/loginSignupPage', component: LoginSignupPage },
            { path: '/addPhoneNo', component: AddPhoneNo },
            { path: '/otpVerification', component: OtpVerification },
            { path: '/dashboard', component:Dashboard},
            { path: '/forgetPassword', component: ForgotPassword },
            { path: '/resetPassword', component: ResetPassword},
            { path: '/editProfile', component:EditProfile},
            { path: '/', exact: true, redirectTo: localStorage.getItem('UserId') ? '/dashboard' : '/loginSignupPage' }
        ];

    }    
}
export default Router;
